css:
.git-control .menu {
  border-bottom: 1px solid #201f1d;
  background: inherit;
}
.git-control .menu .item {
  display: inline-block;
  margin: 5px 0 5px 5px;
  padding: 5px;
  cursor: pointer;
  border-radius: 4px;
  -webkit-user-select: none;
}
.git-control .menu .item:hover {
  color: #dddcda;
}
.git-control .menu .item.inactive,
.git-control .menu .item.inactive:hover {
  opacity: .5;
  pointer-events: none;
  cursor: default;
}
.git-control .menu .item.hide {
  display: none;
}
.git-control .menu .item div {
  text-align: center;
  width: 100%;
  min-width: 60px;
}
